import React from 'react';
import { useNavigate } from 'react-router-dom';

export default function WelcomeScreen() {
  const navigate = useNavigate();

  return (
    <div className="relative min-h-screen w-full flex flex-col justify-between items-center bg-[#393726] text-[#e3d9b1] font-sans">
      {/* Top Bar */}
      <div className="w-full flex justify-between items-start px-8 pt-8 text-lg font-normal">
        <span>Careers (2)</span>
        <span>Get in touch</span>
      </div>

      {/* Centered Branding */}
      <div className="flex flex-col items-center justify-center flex-1">
        <div className="text-center select-none">
          <div className="flex justify-center mb-2">
            <span className="text-5xl md:text-6xl font-bold tracking-wide border-2 border-[#e3d9b1] px-4 pb-1 pt-0.5 rounded-sm" style={{letterSpacing: '0.06em'}}>
              ARES
            </span>
          </div>
          <div className="text-4xl md:text-5xl font-bold tracking-wide leading-tight">TRADING</div>
          <div className="text-4xl md:text-5xl font-bold tracking-wide leading-tight mb-4">EXCHANGE</div>
          <div className="text-lg md:text-xl font-normal tracking-wider mb-8">MEME COIN DEFI EXCHANGE</div>
          <button
            className="mt-2 px-12 py-3 rounded bg-[#393726] border border-[#b3a97c] text-[#e3d9b1] text-lg font-medium shadow-md hover:bg-[#4a482e] hover:shadow-lg transition-all duration-150 focus:outline-none focus:ring-2 focus:ring-[#e3d9b1] focus:ring-offset-2"
            onClick={() => navigate('/feed')}
          >
            ENTER
          </button>
        </div>
      </div>

      {/* Bottom Center */}
      <div className="w-full flex justify-center items-end pb-8">
        <span className="text-lg font-normal">Our Products</span>
      </div>
    </div>
  );
}
